import React, { useState } from "react";
import axios from "axios";
import './App.css';

function ConversationalForm({ onSubmit }) {
  const [name, setName] = useState("");
  const [email, setEmail] = useState("");
  const [phone, setPhone] = useState("");
  const [date, setDate] = useState("");
  const [step, setStep] = useState(1);

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const formData = { name, email, phone, date };
      await axios.post("http://localhost:5000/save-data", formData);
      alert("Your information has been saved.");
      onSubmit(); // Close the form
    } catch (err) {
      console.error(err);
      alert("An error occurred while saving your data.");
    }
  };

  const handleNextStep = () => {
    setStep(step + 1);
  };

  const renderForm = () => {
    if (step === 1) {
      return (
        <div>
          <label>What is your name?</label>
          <input type="text" value={name} onChange={(e) => setName(e.target.value)} required />
          <button onClick={handleNextStep}>Next</button>
        </div>
      );
    } else if (step === 2) {
      return (
        <div>
          <label>What is your email address?</label>
          <input type="email" value={email} onChange={(e) => setEmail(e.target.value)} required />
          <button onClick={handleNextStep}>Next</button>
        </div>
      );
    } else if (step === 3) {
      return (
        <div>
          <label>Please provide your phone number.</label>
          <input type="tel" value={phone} onChange={(e) => setPhone(e.target.value)} required />
          <button onClick={handleNextStep}>Next</button>
        </div>
      );
    } else if (step === 4) {
      return (
        <div>
          <label>When do you want to book?</label>
          <input type="text" value={date} onChange={(e) => setDate(e.target.value)} required />
          <button type="submit">Submit</button>
        </div>
      );
    }
  };

  return (
    <form onSubmit={handleSubmit}>
      {renderForm()}
    </form>
  );
}

function App() {
  const [query, setQuery] = useState("");
  const [history, setHistory] = useState([]);
  const [showForm, setShowForm] = useState(false);

  const handleQuerySubmit = async (e) => {
    e.preventDefault();
    if (query.trim() === "") return;

    try {
      const res = await axios.post("http://localhost:5000/query", { query });
      const chatbotResponse = res.data.response;

      setHistory([...history, { query, response: chatbotResponse }]);
      if (chatbotResponse.toLowerCase().includes("call them")) {
        setShowForm(true);
      }
      setQuery("");
    } catch (err) {
      console.error(err);
    }
  };

  return (
    <div>
      <h1>Chatbot</h1>
      <div className="chat-history">
        {history.map((entry, index) => (
          <div key={index}>
            <p><strong>You:</strong> {entry.query}</p>
            <p><strong>Bot:</strong> {entry.response}</p>
          </div>
        ))}
      </div>
      <form onSubmit={handleQuerySubmit}>
        <input
          type="text"
          value={query}
          onChange={(e) => setQuery(e.target.value)}
          placeholder="Ask a question"
        />
        <button type="submit">Submit</button>
      </form>
      {showForm && <ConversationalForm onSubmit={() => setShowForm(false)} />}
    </div>
  );
}

export default App;
